window.bookSummaryJSON = "<p>Catalina only made her deal with the demon because she had nowhere else to go. The world has kicked her every chance it got, so she’s all too happy to leave the realm she knows behind. What’s the worst that could happen?</p> <p>She doesn’t anticipate being auctioned away to a kraken.</p> <p>Thane is cold and distant…but he’s not unkind. Isolated as they are, Catalina finds herself seeking his company again and again. And when she finally agrees to uphold her portion of the bargain?</p> <p>That’s when things get really interesting.</p> <p>But she only gave the demon seven years, and when the time is up, she’ll have no choice but to leave behind the kraken who’s stolen her heart and return to the world that doesn’t want her.</p> <p>Author’s Note: For all tropes, tags, and CWs, please check the author’s website.</p>"; 
